import './App.css';
import {BrowserRouter as Routes,Route} from 'react-router-dom'
import Header from './components/Header';
import NotesListPage from './pages/NotesListPage';

function App() {
  return (
    <Routes>
    <div className="App">
      <Header/>
      <Route path="/" exact element={ <NotesListPage/>}/>
    </div>
    </Routes>
  );
}

export default App;
